import { useEffect, useState } from "react";
import ComingSoon from './ComingSoon';

const Updates = () => {
    const [animes, setAnimes] = useState({})
    useEffect((_id) => {
		axios('http://localhost:8000/comingsoon')
		.then(res => {
		  setAnimes(res.data)
		})
	  }, []);
    return(

        <div>
            <h1>Coming Soon!</h1>
            {
            animes.map(anime => {
                return <ComingSoon anime={anime}/>
            })
            }
        </div>
    );
}

export default Updates;
